import Nav from 'react-bootstrap/Nav';

export default () => {
  return (
    <div>
      <Nav
        defaultActiveKey="/home"
        className="justify-content-end text-right mr-5"
      >
        <Nav.Link className="mr-5" href="/portfolio">
          Portfolio
        </Nav.Link>
        <Nav.Link className="mr-5" eventKey="link-1">
          Stacks
        </Nav.Link>
        <Nav.Link className="mr-5" eventKey="link-2">
          Contacts
        </Nav.Link>
      </Nav>
    </div>
  );
};
